import React from 'react';
import { useNavigate } from 'react-router-dom';

function LanguageSelector() {
  let navigate = useNavigate();

  const changeLanguage = (lang) => {
    navigate(`/${lang}`);
    // Dodajte ovdje dodatnu logiku ako je potrebno
  };

  return (
    <div className="select-language">
      <img src="/images/german.png" alt="German" onClick={() => changeLanguage("de")} />
      <img src="/images/italian.png" alt="Italian" onClick={() => changeLanguage("it")} />
      <img src="/images/english.png" alt="English" onClick={() => changeLanguage("en")} />
    </div>
  );
}

export default LanguageSelector;
